import logo from './logo.svg';
import staringCat from './staringCat.jpg';
import Image from './Image';
import './App.css';

function App() {
  return (
    <main>
      <Image source={staringCat} alternativeText="Cute cat staring" />
    </main>
  );
}

export default App;
